import React from 'react';
import PropTypes from 'prop-types';
import './Checkbox.css';



function Checkbox(props) {

return(
  <div className="form-check">
    <label>
      <input
        type="checkbox"
        name={props.label}
        checked={props.isSelected}
        onChange={props.onCheckboxChange}
        className="form-check-input"
      />
      {props.label}
    </label>
  </div>
);
}

